data:
  definition: mouvement périodique d'un conducteur ou d'un faisceau de conducteurs,
    se produisant principalement dans un plan vertical, à fréquence basse de l'ordre
    d'une fraction de Hz et avec une grande amplitude de l'ordre de la flèche initiale
